(function() {
  $(window).on('load', function() {});

  $(document).on('turbolinks:load', function() {
    'use strict';
    var contactBtn, headerHeight;
    window.DISQUSWIDGETS = void 0;
    $('.sidebar-dropdown > a').click(function() {
      $('.sidebar-submenu').slideUp(200);
      if ($(this).parent().hasClass('active')) {
        $('.sidebar-dropdown').removeClass('active');
        $(this).parent().removeClass('active');
      } else {
        $('.sidebar-dropdown').removeClass('active');
        $(this).next('.sidebar-submenu').slideDown(200);
        $(this).parent().addClass('active');
      }
    });
    $('#show-sidebar2').click(function() {
      $('.page-wrapper').addClass('toggled');
      $('.page-content').addClass('content-toggled');
      $('.page-content').addClass('exec');
    });
    $('#close-sidebar').click(function() {
      $('.page-wrapper').removeClass('toggled');
      $('.page-content').removeClass('content-toggled');
      $('.page-content').removeClass('exec');
    });
    $('.page-content').click(function() {
      if ($('.page-content').hasClass('content-toggled')) {
        if (!$('.page-content').hasClass('exec')) {
          $('.page-wrapper').removeClass('toggled');
          $('.page-content').removeClass('content-toggled');
        } else {
          $('.page-content').removeClass('exec');
        }
      }
    });
    $.getScript("//pigboars.disqus.com/count.js", function() {
      $('#masonry-container').masonry({
        percentPosition: true,
        itemSelector: '.mas-box',
        gutter: '.gutter-sizer',
        isResizable: true
      });
      $('.mas-box').each(function(i) {
        return $(this).animate({
          opacity: '1'
        }, 1000);
      });
      return $('#more_link').animate({
        opacity: '1'
      }, 1000);
    });
    return;
    contactBtn = $('#contact_btn');
    $('body').on('input propertychange', '.floating-label-form-group', function(e) {
      $(this).toggleClass('floating-label-form-group-with-value', !!$(e.target).val());
    }).on('focus', '.floating-label-form-group', function() {
      $(this).addClass('floating-label-form-group-with-focus');
    }).on('blur', '.floating-label-form-group', function() {
      $(this).removeClass('floating-label-form-group-with-focus');
    });
    $('#mainNav').css({
      'background-color': 'transparent'
    });
    headerHeight = $('#mainNav').height();
    return $(window).on('scroll', {
      previousTop: 0
    }, function() {
      var currentTop;
      currentTop = $(window).scrollTop();
      if (currentTop < 50) {
        $('#mainNav').css({
          'background-color': 'transparent'
        });
      } else {
        $('#mainNav').css({
          'background-color': '#2E2E2E'
        });
      }
      if (currentTop < this.previousTop) {
        if (currentTop > 0 && $('#mainNav').hasClass('fixed-top')) {
          $('#mainNav').slideDown();
        } else {
          $('#mainNav').slideDown();
          $('#mainNav').addClass('fixed-top');
        }
      } else if (currentTop > this.previousTop) {
        $('#mainNav').slideUp();
      }
      this.previousTop = currentTop;
      return;
      contactBtn.click(function() {
        return $('body,html').stop().animate({
          scrollTop: $("#contact").offset().top
        }, 300);
      });
    });
  });

}).call(this);
